$intervenants = [];

// générer de nouveaux prénoms
$i   = "
SELECT distinct
  i.source_code,
  CASE WHEN i.z_civilite_id = 'M.' THEN 'M' ELSE 'F' END civ
FROM
  mv_intervenant_demo i

UNION

SELECT distinct
  i.source_code,
  CASE WHEN c.libelle_long = 'Monsieur' THEN 'M' ELSE 'F' END civ
FROM
  intervenant i
  JOIN civilite c ON c.id = i.civilite_id
";
$em  = $sl->get(\Application\Constants::BDD);
$res = $em->getConnection()->executeQuery($i)->fetchAll();
foreach ($res as $r) {
    $code = $r['SOURCE_CODE'];
    $civ  = $r['CIV'];
    if (!isset($intervenants[$code])) {
        $prenom              = $prenoms[$civ][rand(0, count($prenoms[$civ]) - 1)];
        $nom                 = $noms[rand(0, count($noms) - 1)];
        $intervenants[$code] = ['nom' => $nom, 'prenom' => $prenom];
    }
}


// Générer les requêtes SRC_INTERVENANT
foreach ($intervenants as $code => $i) {
    $prenom = "q'[" . $i['prenom'] . "]'";
    $nom    = "q'[" . $i['nom'] . "]'";

    $sql = "UPDATE mv_intervenant_demo SET prenom=$prenom , nom_usuel=$nom, nom_patronymique=$nom WHERE source_code = $code;";
    echo $sql . "<br />\n";

    $sql = "UPDATE intervenant SET prenom=$prenom , nom_usuel=$nom, nom_patronymique=$nom WHERE source_code = $code;";
    echo $sql . "<br />\n";
}
